  [],\n\t\"revision_timestamp\": \"2016-03-21T22:02:47.320193\",\n\t\"name\": \"habitat-use-database-groundfish-essential-fish-habitat-habitat-use-database-hud\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Habitat Use Database (HUD) was specifically
  designed to address the need for habitat-use analyses in support of groundfish EFH,
  HAPCs, and fishing and nonfishing impacts components of the 2005 EFH EIS. nHUD functionality
  and accessibility, and the ecological information upon which the HUD is based, will
  be  improved in order for this database to fully support fisheries and ecosystem
  science and management. Upgrades to and applications of the HUD will be facilitated
  through a series of prioritized phases:nn Fully integrate the data entry, quality
  control, and reporting capabilities from the original HUD Access database with a
  web-based and programmatic interface. Improve software for HUD to accommodate the
  most current habitat maps and habitat classification codes. This will be achieved
  by NMFS in consultation with HUD architects at Oregon State University.nn Review
  and update the biological and ecological information in the HUD. nn Develop and
  apply improved models that will be used to create updated habitat suitability maps
  for all west coast groundfish species using the updated HUD and Pacific coast seafloor
  habitat maps.nn Integrate habitat suitability models with the online groundfish
  EFH data catalogn(http://efh-catalog.coas.oregonstate.edu/overview/).nn2005 habitat-use
  analysis supporting groundfish EFH.\",\n\t\"license_title\": null,\n\t\"extras\":
